on <ScreenSize>\n        Given A user opens the Polls.io website on \"<ScreenSize>\"\n        When User enters the poll question \"This is the test question\"\n        When User click add another option button for 2 times\n        And User fill up the poll options\n            | position | name            |\n            |   1      | Option 1 Sample |\n            |   2      | Option 2 Sample |\n            |   3      | Option 3 Sample |\n            |   4      | Option 4 Sample |\n            |   5      | Option 5 Sample |\n        And A user clicks on the Create this poll button\n        Then Poll page will displayed with the question and 5 options\n            | question                  | option1         | option2         | option3         | option4         | option5         |\n            | This is the test question | Option 1 Sample | Option 2 Sample | Option 3 Sample | Option 4 Sample | Option 5 Sample |\n        When User click vote on answer page\n        And User click \"Option 3 Sample\" from the option list checkbox\n        And Click submit button\n        Then Result page will be displayed\n\n        Examples:\n            | ScreenSize  |\n            | iphone-x    |\n            | macbook-15  |\n\n    Scenario: Show Error When Poll is Created With 1 Option\n        Given A user opens the Polls.io website\n        When User enters the poll question \"This is the test question\"\n        And User fill up the poll options\n            | position | name            |\n            |   1      | Option 1 Sample |\n        And A user clicks on the Create this poll button\n        Then Error messages \"You must enter at least two options.\" is displayed\n\n    Scenario: Show Error When Poll is Created Without Option\n        Given A user opens the Polls.io website\n        When User enters the poll question \"This is the test question\"\n        And A user clicks on the Create this poll button\n        Then Error messages \"You must enter at least two options.\" is displayed\n\n    Scenario: Verify Add Another Option Button is Working\n        Given A user opens the Polls.io website\n        When User click add another option button for 2 times\n        Then 2 New option fields is added from initial 3\n\n    Scenario: Show Error If Question is less than 10 character\n        Given A user opens the Polls.io website\n        When User enters the poll question \"Short\"\n        And User fill up the poll options\n            | position | name            |\n            |   1      | Option 1 Sample |\n            |   2      | Option 2 Sample |\n        And A user clicks on the Create this poll button\n        Then Error messages \"Question must be at least 10 characters long\" is displayed\n\n    Scenario: Verify Translation Features is working\n        Given A user opens the Polls.io website\n        When User click language button\n        And User select \"Deutsch\"\n        Then the page is translated to Deutsch\n            |Welcometo      | SiteDescription                 | QuestionLabel                             | OptionLabel                                      | CreatePollButton  | AddOptionButton             |\n            |Willkommen auf | Erstellen Sie einfache Umfragen | Geben Sie eine Frage fr Ihre Umfrage ein | Geben Sie beliebig viele Antwortmglichkeiten an | Umfrage erstellen | Weitere Optionen hinzufgen |\n\n    Scenario: Verify Popular Pools Section Displayed Correctly\n        Given A user opens the Polls.io website\n        When User navigate to popular polls Section\n        Then The section display correctly with 8 popular polls\n        When User click on the first popular polls\n        Then User are navigated to the poll page\n\n    Scenario: Show Error When Create Poll Button is clicked under 10 seconds after the page load\n        Given A user opens the Polls.io website\n        When User enters the poll question \"This is the test question\"\n        And User fill up the poll options\n            | position | name            |\n            |   1      | Option 1 Sample |\n            |   2      | Option 2 Sample |\n        And A user clicks on the Create this poll button without waiting 10 seconds\n        Then Error messages \"Unfortunately, your request has been classified as spam by our system. You should submit the form first 10 seconds after opening it and don't fill any hidden form fields. Please try again.\" is displayed\n\n    Scenario: User can navigate to terms page\n        Given A user opens the Polls.io website\n        When User click term hyperlink at the footer section\n        Then User is navigated to Terms and Condition page\n\n    Scenario: User can navigate to blog page\n        Given A user opens the Polls.io website\n        When User click blog hyperlink at the footer section\n        Then User is navigated to Blog page\n\n    Scenario: User can navigate to contact page\n        Given A user opens the Polls.io website\n        When User click contact hyperlink at the footer section\n        Then User is navigated to Contact Us page\n\n    Scenario: User can navigate to Polls IO Twitter page\n        Given A user opens the Polls.io website\n        When User click Follow Us On Twitter at the footer section\n        Then User is navigated to Poll IO Twitter page\n\n    Scenario: User can navigate to Polls IO Linkedin page\n        Given A user opens the Polls.io website\n        When User click Follow Us On Linkedin at the footer section\n        Then User is navigated to Poll IO Linkedin page","mediaType":"text/x.cucumber.gherkin+plain"}},{"gherkinDocument":{"comments":[],"feature":{"location":{"line":1,"column":1},"tags":[],"language":"en","keyword":"Feature","name":"Polls IO Homepage","description":"    Verify Polls IO Homepage","children":[{"scenario":{"location":{"line":5,"column":5},"tags":[],"keyword":"Scenario Outline","name":"Scenario Outline name: Create and Answer Poll With Minimum 2 Options on <ScreenSize>","description":"","  |\n    | Sample Question For Question Page Test | Sample Option 1 | Sample Option 2 | Sample Option 3 | Sample Option 4 | Sample Option 5 |\n\n    Background:\n        Given Polls question is created\n\n    Scenario: User can only select 1 answer from the poll\n        Given User opens the Polls.io Question Page\n        When User click vote on answer page\n        And User click \"Sample Option 4\" from the option list checkbox\n        And User click \"Sample Option 5\" from the option list checkbox\n        Then \"Sample Option 4\" checkbox will be unchecked\n        And \"Sample Option 5\" checkbox will be checked\n    \n    Scenario: Click View Result Button Will Show The Poll Result\n        Given User opens the Polls.io Question Page\n        When User click vote on answer page\n        And User click view result button\n        Then Result page will be displayed\n\n    Scenario: Open and Answer Question Directly From Direct URL\n        Given User opens the Polls.io Question Page\n        When User click vote on answer page\n        And User click \"Sample Option 2\" from the option list checkbox\n        And Click submit button\n        Then Result page will be displayed\n\n    Scenario: Click back button will redirect user to home page\n        Given User opens the Polls.io Question Page\n        When User click the back button\n        Then User redirected back to home page\n\n    Scenario: Verify copy link from share button is correct\n        Given User opens the Polls.io Question Page\n        When User click the share button\n        And User click copy link and the link is correct\n        Then Copied to clipboard banner displayed\n\n    Scenario: Verify embed code link is correct\n        Given User opens the Polls.io Question Page\n        When User click the share button\n        And User click copy embed code\n        Then Embed code popup will be displayed with correct embed code\n\n    Scenario: Verify share to Facebook is working\n        Given User opens the Polls.io Question Page\n        When User click the share button\n        And User click share to Facebook\n        Then New windows with correct Facebook URL is open\n    \n    Scenario: Verify share to Twitter is working\n        Given User opens the Polls.io Question Page\n        When User click the share button\n        And User click share to Twitter\n        Then New windows with correct Twitter URL is open\n\n    Scenario: Verify share to Linkedin is working\n        Given User opens the Polls.io Question Page\n        When User click the share button\n        And User click share to Linkedin\n        Then New windows with correct Linkedin URL is open","mediaType":"text/x.cucumber.gherkin+plain"}},{"gherkinDocument":{"comments":[],"feature":{"location":{"line":1,"column":1},"tags":[],"language":"en","keyword":"Feature","name":"Polls IO Question Page","description":"    Verify Polls IO Question Page With The Following Question and Options\n    | question                               | option1         | option2         | option3         | option4         | option5         |\n    | Sample Question For Question Page Test | Sample Option 1 | Sample Option 2 | Sample Option 3 | Sample Option 4 | Sample Option 5 |","children":[{"background":{"location":{"line":7,"column":5},"keyword":"Background","name":"","description":"","steps":[{"location":{"line":8,"column":9},"keyword":"Given ","text":"Polls question is created","id":"85d54980-85c8-4cb8-8223-011a9ce68fee","keywordType":"Context"}],"id":"9263055c-6f3b-4340-8094-2d8e777fc7f0"}},{"scenario":{"location":{"line":10,"column":5},"tags":[],"keyword":"Scenario","name":"User can only select 1 answer from the poll","description":"","steps":[{"location":{"line":11,"column":9},"keyword":"Given ","text":"User opens the Polls.io Question Page","id":"0acb4231-a771-4823-b954-0650b7593440","keywordType":"Context"},{"location":{"line":12,"column":9},"keyword":"When ","text":"User click vote on answer page","i
